
PIB_PAYLOAD = {
    "script_HiddenField": "",
    "__EVENTTARGET": "ctl00$ContentPlaceHolder1$ddlday",
    "__EVENTARGUMENT": "",
    "__LASTFOCUS": "",
    "__VIEWSTATE": "",
    "__VIEWSTATEGENERATOR": "CBED066B",
    "__VIEWSTATEENCRYPTED": "",
    "__EVENTVALIDATION": "",
    "ctl00$Bar1$ddlregion": "3",
    "ctl00$Bar1$ddlLang": "1",
    "ctl00$ContentPlaceHolder1$hydregionid": "3",
    "ctl00$ContentPlaceHolder1$hydLangid": "1",
    "ctl00$ContentPlaceHolder1$ddlMinistry": "0",
    "ctl00$ContentPlaceHolder1$ddlday": "21", 
    "ctl00$ContentPlaceHolder1$ddlMonth": "4",
    "ctl00$ContentPlaceHolder1$ddlYear": "2025",
}

def get_payload(day: int, month: int, year: int) -> dict:
    """
    Creates a copy of the PIB payload with updated date values.
    
    Args:
        day (int): Day of the month (1-31)
        month (int): Month number (1-12) 
        year (int): Full year (e.g. 2025)

    Returns:
        dict: Copy of PIB_PAYLOAD with updated date fields
    """
    payload = PIB_PAYLOAD.copy()
    payload["ctl00$ContentPlaceHolder1$ddlday"] = str(day)
    payload["ctl00$ContentPlaceHolder1$ddlMonth"] = str(month)
    payload["ctl00$ContentPlaceHolder1$ddlYear"] = str(year)
    return payload